insert  into `questions`(`question_id`,`sub_module_id`,`question`,`is_active`,`created_at`,`updated_at`) values 
(1,3,'1.	This engine powers both Isuzu mu-X and Isuzu D-Max and is now Euro 4 compliant.',1,'2018-12-17 13:21:29','2018-12-17 13:21:29'),
(2,3,'The 6WG1-TCR Euro V engine powers our C & E Series heavy duty trucks. How much power and torque does it give to our trucks?',1,'2018-12-17 13:23:11','2018-12-17 13:23:11'),
(3,3,'Which of the following Isuzu F-Series trucks is not equipped with a Full Air Brake System?',1,'2018-12-17 13:40:19','2018-12-17 13:40:19'),
(4,3,'It is the automatic transmission equipped to our Isuzu mu-X 3.0L LS-A 4x2 A/T Blue Power.',1,'2018-12-17 13:46:41','2018-12-17 13:46:41'),
(5,4,'This tool is used to apply impact or shock by striking the object in order to fit or drive parts in place, break apart or disassemble components.',1,'2018-12-17 13:52:54','2018-12-17 13:52:54'),
(6,4,'These two turning tools are used for nuts and bolts that are located on hard to reach areas and tight spaces making loosening and tightening easier.',1,'2018-12-17 13:54:33','2018-12-17 13:54:33'),
(7,4,'This tool allows turning of bolts and nuts rapidly in one direction. Direction of rotation can be reversed using the lock lever.',1,'2018-12-17 13:55:58','2018-12-17 13:55:58'),
(8,4,'It is used for holding, bending, twisting and cutting workpieces. It is also sometimes used to install and remove snap rings and piston rings.',1,'2018-12-17 13:57:59','2018-12-17 13:57:59'),
(9,4,'It is used to tighten or loosen a bolt or a nut. It has a 15 degree incline with respect to its handle to make turning of bolts and nuts easier on tight spaces.',1,'2018-12-17 13:59:28','2018-12-17 13:59:28'),
(10,4,'It is a type of wrench in which it holds the heads of bolts and nuts around making tightening and loosening more secured.',1,'2018-12-17 14:00:30','2018-12-17 14:00:30'),
(11,4,'It is one of the turning tools found in the workshop which has various tips available in order to tighten or loosen screws.',1,'2018-12-17 14:04:55','2018-12-17 14:04:55'),
(12,4,'It can be used for nuts of various sizes by combining or connecting this with different types of handles, extension bars and joints for hard to reach areas.',1,'2018-12-17 14:06:52','2018-12-17 14:06:52'),
(13,4,'It is a type of pliers in which technicians use this if strong grip is required and can be used also to remove damaged bolt or seized nut.',1,'2018-12-17 14:08:30','2018-12-17 14:08:30'),
(14,4,'It is a tool used to cut female screw in a hole of a work.',1,'2018-12-17 14:09:35','2018-12-17 14:09:35'),
(15,4,'It is one of the power tools used to drill holes in a workpiece and is portable and can be used in any location.',1,'2018-12-17 14:10:45','2018-12-17 14:10:45'),
(16,4,'It provides supply of compressed air to be used in other power tools which use air as a power source.',1,'2018-12-17 14:12:18','2018-12-17 14:12:18'),
(17,4,'It enables loosening and tightening of bolts and nuts rapidly by holding the top end with one hand and rotating the U-Shaped crank with the other hand.',1,'2018-12-17 14:42:30','2018-12-17 14:42:30'),
(18,4,'A type of measuring tool that measures bend, runout of a shaft, parallelism or surface roughness as well as height and projections/protrusion of objects like pistons.',1,'2018-12-17 14:43:52','2019-06-07 11:18:09'),
(19,4,'It is used to measure oil clearances between crank pin and bearing and it is made out of plastic and shaped like a filament with uniform thickness.',1,'2018-12-17 14:45:09','2018-12-17 14:45:09'),
(20,4,'A type of measuring tool that is used to tighten a bolt or nut at a specified torque.',1,'2018-12-17 14:46:50','2018-12-17 14:46:50'),
(21,4,'It is used to measure the clearance between two parts of a workpiece and is composed of thin sheets of steel with varying thickness.',1,'2018-12-17 14:48:23','2018-12-17 14:48:23'),
(22,4,'It is a type of torque wrench in which it has an arm made of plate spring and allows tightening torque to be read directly at the plate based on deflection of its indicator.',1,'2018-12-17 14:49:35','2019-06-07 11:19:29'),
(23,4,'A type of measuring tool in which it is mainly used for measuring outer diameter or length which has a minimum reading of 0.01 mm.',1,'2018-12-17 14:50:56','2018-12-17 14:50:56'),
(24,4,'A measuring tool that can be used to measure inside diameter, outside diameter as well as depth of a workpiece.',1,'2018-12-17 14:51:52','2018-12-17 14:51:52'),
(25,4,'Before storing the micrometer to its case after use, the technician should...',1,'2018-12-17 14:54:14','2018-12-17 14:54:14'),
(26,4,'When measuring a depth of a workpiece having a wide opening using a Vernier Caliper, it is necessary to...',1,'2018-12-17 14:57:41','2018-12-17 14:57:41'),
(27,4,'A diagnostic tool used to current Isuzu Electronic Control Units in order to diagnose, inspect and repair problems related to electronic control.',1,'2018-12-17 15:38:34','2018-12-17 15:38:34'),
(28,4,'In G-IDSS, it contains different tools that can be used during inspection and diagnosis of Isuzu Vehicles.',1,'2018-12-17 16:01:49','2018-12-17 16:01:49'),
(29,4,'This system monitors and records vehicle information useful in diagnosing past, present and future vehicle service issues and mostly used in cases that are hard to duplicate or reproduce.',1,'2018-12-17 16:03:31','2018-12-17 16:03:31'),
(30,4,'It is a part of the G-IDSS that contains service information of Isuzu Vehicle components similar to that of workshop manual for quick reference during vehicle servicing.',1,'2018-12-17 16:07:32','2018-12-17 16:07:32'),
(31,4,'This part of the G-IDSS lets you monitor live parameters of the vehicle sensors and actuators through Data List.',1,'2018-12-17 16:09:46','2018-12-17 16:09:46'),
(32,4,'This allows you to update and reprogram various controllers based on part numbers and or available calibration files.',1,'2018-12-17 16:10:43','2018-12-17 16:10:43'),
(33,4,'A system that monitors the conditions of the vehicle while it is being used and collects data from the vehicle via DRM.',1,'2018-12-17 16:13:29','2018-12-17 16:13:29'),
(34,4,'It connects the Interface Box and the vehicle via DLC Terminal.',1,'2018-12-17 16:15:16','2018-12-17 16:15:16'),
(35,5,'It describes the act of inspecting or testing the condition of car sub-systems and servicing or replacing of parts and fluids.',1,'2018-12-17 16:18:03','2018-12-17 16:18:03'),
(36,5,'It removes impurities contained in the engine oil allowing clean oil to lubricate the internal parts of the engine.',1,'2018-12-17 16:22:23','2018-12-17 16:22:23'),
(37,5,'It is one of the functions of engine oil that absorbs heat generated by friction and combustion.',1,'2018-12-17 16:23:17','2018-12-17 16:23:17'),
(38,5,'A continuous belt that is used to drive multiple accessories in a car\'s engine such as alternator and water pump.',1,'2018-12-17 16:24:12','2018-12-17 16:24:12'),
(39,5,'This part of the engine traps dust and dirt particles in the air preventing them from entering the cylinders.',1,'2018-12-17 16:25:13','2018-12-17 16:25:13'),
(40,5,'It is used as a heat transfer medium having a cryoprotective and rust prevention performance.',1,'2018-12-17 16:25:57','2018-12-17 16:25:57'),
(41,5,'It provides lubrication to all engine moving parts in order to protect them from wear and be able to move smoothly during operation.',1,'2018-12-17 16:27:59','2018-12-17 16:27:59'),
(42,5,'This procedure is done when air enters the fuel lines due to leak, emptied fuel tank or removal of fuel pump for servicing. Insufficient removal may result to engine malfunction.',1,'2018-12-17 16:35:25','2018-12-17 16:35:25'),
(43,5,'A mechanical device that provides transmission of power and usually motion from one component to another when engaged but can be disengaged.',1,'2018-12-17 16:37:10','2018-12-17 16:37:10'),
(44,5,'This fluid is used to transmit force into pressure, and to amplify braking force and provide lubrication for the moving parts in a brake system.',1,'2018-12-17 16:38:27','2018-12-17 16:38:27'),
(45,5,'This is a device or an assembly between two shafts that permits the shaft to turn at different speed while continuing to transmit torque.',1,'2018-12-17 16:40:13','2018-12-17 16:40:13'),
(46,5,'It is a system that allows the driver to control the direction of the vehicle.',1,'2018-12-17 16:41:06','2018-12-17 16:41:06'),
(47,5,'It is the rating for thickness or thinness of oil.',1,'2018-12-17 16:44:58','2018-12-17 16:44:58'),
(48,5,'It removes impurities from fuel such as iron rust, dust, dirt and water which may cause clogging or wear of the supply pump and injector and may shorten the life of the engine.',1,'2018-12-17 16:46:54','2018-12-17 16:46:54'),
(49,6,'A type of machine designed to produce power and to propel automobiles to be able to go from point A to point B.',1,'2018-12-17 16:57:19','2018-12-17 16:57:19'),
(50,6,'A type of engine in which it uses light oil as fuel and is mostly used in commercial vehicles due to fuel economy and high thermal efficiency.',1,'2018-12-17 17:03:07','2018-12-17 17:03:07'),
(51,6,'It is one of the unique features of Gasoline Engines compared to Diesel Engines during intake stroke.',1,'2018-12-17 17:04:05','2018-12-17 17:04:05'),
(52,6,'The thermal efficiency of Diesel Engines as compared to Gasoline Engines.',1,'2018-12-17 17:04:59','2018-12-17 17:04:59'),
(53,6,'For Diesel Engines, it is the stroke in which only air enters the cylinders as the piston goes down to BDC.',1,'2018-12-17 17:05:55','2018-12-17 17:05:55'),
(54,7,'It is the volume discharged when the piston moves from bottom dead center to top dead center.',1,'2018-12-17 17:08:19','2018-12-17 17:08:19'),
(55,7,'It is a graph that shows the power and torque according to ranges of engine speed and indicates the characteristics of the engine depending on the RPM.',1,'2018-12-17 17:09:42','2018-12-17 17:09:42'),
(56,7,'It is the ability to cause something to rotate or turning force.',1,'2018-12-17 17:10:42','2018-12-17 17:10:42'),
